import React from 'react'
import './login.css'
const Login = () => {
    return (
        <>
            <h1>LOGIN PAGE</h1>
            <label className='label1'>Email</label>
            <input className="input1"type ="email"/>
            <label className='label2'>Password</label>
            {/* <input type = "password"/>
            <button>Login</button> */}
        </>
    )
}

export default Login
